import React from "react";
import './nav.css';
import Nav from "./nav.js";
import Link from './links/links';


function Navigation() {
    
     return(
        <div className="nav">       
            <div className="navRow" >

                {Nav.map((item) => (
                <Link href={item.href} className="navLink" key={item.section}> {item.section} </Link >      
                            
                ))}

            </div>
        </div> 
     )
}
export default Navigation
